import React from 'react';

const LandingPage: React.FC = () => {
  return (
    <div>
      <h1>Iva Park</h1>
      <p>
        Hello there, I am a UI/UX designer passionate about turning complex
        ideas into intuitive, engaging experiences.
      </p>
    </div>
  );
};

export default LandingPage;
